import React, {Component} from 'react';
import YoutubeComp from '../../ component/YoutubeComponent/YoutubeComp';
import Product from '../Product/Product';
import LifeCycleComp from '../LifeCycleComp/LifeCycleComp'
import BlogPost from '../BlogPost/BlogPost'
import {BrowserRouter as Router, Route, Link, BrowserRouter} from 'react-router-dom'
class Home extends Component{
    state = {
        showComponent : true
    }
    componentDidMount(){
        // setTimeout(() => {
        //     this.setState({
        //         showComponent: false
        //     }) 
        // }, 15000);
    }
    render(){
        return (
            <BrowserRouter>

            <div>
                <p>Youtube Component</p>
                <hr/>
                <YoutubeComp 
                time = '7.12' 
                title = 'belajar reactjs bagian - 1' 
                desc ='belajar reactjs bersama channel prawito hudoro'/>
                <YoutubeComp 
                time = '6.12' 
                title = 'belajar reactjs bagian - 2' 
                desc ='belajar reactjs bersama channel prawito hudoro'/>
                <YoutubeComp 
                time = '5.12' 
                title = 'belajar reactjs bagian - 3' 
                desc ='belajar reactjs bersama channel pra wito hudoro'/>
                <YoutubeComp 
                time = '4.12' 
                title = 'belajar reactjs bagian - 4' 
                desc ='belajar reactjs bersama channel prawito hudoro'/>
                <YoutubeComp 
                title = 'belajar reactjs bagian - 5' 
                desc ='belajar reactjs bersama channel prawito hudoro'/>
                <p>Counter</p>
                <hr/>
                <Product/>

                <p>LifeCycle Component</p>
                <hr/>
                {
                    this.state.showComponent
                    ?
                    <LifeCycleComp/>
                    : null
                }

                <p>Blog Post</p>
                <hr/>
                <BlogPost/>
                
            </div>
            </BrowserRouter>

        )
    }
}

export default Home;
